import React from 'react'
import { Card } from 'antd'
import styled from "@emotion/styled";

const Details = () => {
  return (
    <Card title="Income" bordered={false} style={{ width: 300, borderBottom:'4px #666', alignItems:'left' }}>
      <p>Card content</p>
    </Card>
  )
}

export default Details
